import './App.css';
import axios from 'axios';
import React from 'react';

class App extends React.Component {
  state = {details: [], }

  componentDidMount(){
    let data;
    axios.get('http://127.0.0.1:8000/api/v1/articles/')
    .then(res => {
      data = res.data;
      this.setState({
        details: data
      });
    })
    .catch(err => {
      console.log(err);
    })
  }
  render() {
    return (
      <div>
        <h1>Data:</h1>
        {this.state.details.map((output, id) => (
          <div key={id}>
            <p>{data.title}</p>
            <p>{data.description}</p>
          </div>
        ))}
      </div>
    )
  }
}

export default App;
